script: |
  super -f text -I q3330.spq | sort > q3330.out

inputs:
  - name: q3330.spq
    data: |
      SELECT DISTINCT ( + 75 ) AS col2 FROM tab2 (FORMAT parquet), tab1 (FORMAT parquet) cor0 CROSS JOIN tab0 (FORMAT parquet), tab1 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q3330.out
    data: |
      75
